USE hrm;

CREATE TABLE `tb_menu_access` (
  `tbma_id` int(11) NOT NULL AUTO_INCREMENT,
  `tbm_id` int(11) DEFAULT NULL,
  `tbjt_id` int(11) DEFAULT NULL,
  `tbma_enabled` int(11) DEFAULT NULL,
  `tbma_insert` int(11) DEFAULT NULL,
  `tbma_update` int(11) DEFAULT NULL,
  `tbma_delete` int(11) DEFAULT NULL,
  `tbma_view` int(11) DEFAULT NULL,
  `tbma_approve` int(11) DEFAULT NULL,
  PRIMARY KEY (`tbma_id`),
  KEY `tbma_fk_1` (`tbm_id`),
  KEY `tbma_fk_2` (`tbjt_id`),
  CONSTRAINT `tbma_fk_1` FOREIGN KEY (`tbm_id`) REFERENCES `tb_menu` (`tbm_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `tbma_fk_2` FOREIGN KEY (`tbjt_id`) REFERENCES `tb_job_title` (`tbjt_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1860 DEFAULT CHARSET=latin1;


